import { Household } from '../types/household';

/**
 * Nettoie un numéro de téléphone en supprimant les virgules et espaces
 */
function cleanPhoneNumber(phone: string): string {
  return phone.replace(/[\s,]/g, '');
}

/**
 * Parse une chaîne HTML contenant des lignes de tableau (<tr>) en tableau d'objets Household
 */
export function parseHouseholdsFromHTML(html: string): Household[] {
  // Nettoyer les espaces et les retours à la ligne superflus
  const cleanHtml = html.trim();
  
  // Extraire toutes les lignes <tr>
  const trRegex = /<tr>[\s\S]*?<\/tr>/g;
  const rows = cleanHtml.match(trRegex) || [];
  
  // Set pour vérifier les IDs uniques
  const usedIds = new Set<number>();
  
  // Convertir chaque ligne en objet Household
  return rows.map((row) => {
    // Extraire les valeurs des cellules
    const tdRegex = /<td[^>]*>([\s\S]*?)<\/td>/g;
    const cells: string[] = [];
    let match;
    
    while ((match = tdRegex.exec(row)) !== null) {
      cells.push(match[1].trim());
    }
    
    // Extraire l'ID de la première cellule
    let id = parseInt(cells[0]);
    
    // Si l'ID est déjà utilisé ou invalide, générer un nouvel ID unique
    if (isNaN(id) || usedIds.has(id)) {
      id = 1;
      while (usedIds.has(id)) {
        id++;
      }
    }
    
    // Ajouter l'ID au set des IDs utilisés
    usedIds.add(id);
    
    // Créer l'objet Household avec le numéro de téléphone nettoyé
    return {
      id,
      phone: cleanPhoneNumber(cells[1]),
      userName: cells[2],
      address: cells[3],
      serialNumber: cells[4],
      date: cells[5]
    };
  });
}

